// CSS
import "../allPages/styles/AllPages.css";
import "../allPages/styles/Forms.css";

// Javascript & React Components
import React from "react";
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import PageNotFound from "../allPages/pages/PageNotFound";

function StudentMain() {
  return (
    <div className="StudentMain">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<AdminLogin />} />
          {/* <Route path="/Home" element={<AdminHome />} /> */}
          <Route path="/CourseSearch" element={<CourseSearch />} />
          <Route path="/AddCourse" element={<CourseAdd />} />
          <Route path="/RemoveCourse" element={<CourseRemove />} />
          {/* <Route path="/GetHelp" element={<StudentList />} /> */}
          <Route path="*" element={<PageNotFound />} />
        </Routes>
      </Router>
    </div>
  );
}

export default StudentMain;
